/*Table structure for table `doctor` */

DROP TABLE IF EXISTS `doctor`;

CREATE TABLE `doctor` (
  `doctorId` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `doctorName` varchar(30) NOT NULL,
  `age` int(11) DEFAULT NULL,
  `doctorDescription` longtext,
  `level` varchar(20) NOT NULL,
  `hos_dep_Id` int(40) DEFAULT NULL,
  `baiduApiId` varchar(60) DEFAULT NULL,
  `photo` varchar(220) DEFAULT NULL,
  PRIMARY KEY (`doctorId`),
  KEY `hos_dep_Id` (`hos_dep_Id`),
  CONSTRAINT `doctor_ibfk_1` FOREIGN KEY (`hos_dep_Id`) REFERENCES `hospital_department` (`hos_dep_Id`)
) ENGINE=InnoDB AUTO_INCREMENT=511 DEFAULT CHARSET=utf8;

/*Data for the table `doctor` */

insert  into `doctor`(`doctorId`,`doctorName`,`age`,`doctorDescription`,`level`,`hos_dep_Id`,`baiduApiId`,`photo`) values (1,'陆福民',40,'1982年以毕业考试全校第一名成绩毕业于上海第一医学院(现复旦大学医学院)医学系。后获肾病研究生学位，导师邱传禄及林善锬分别曾任第二及第四任中华肾脏病学会主任委员。研究生毕业后留华山医院肾病科任职，(其中曾在比利时鲁汶大学进修一年)，历经主治医生、副教授、主任医生自今(其中曾任科行政副主任二十多年)。多年讲授医学院本科生课程:慢性肾脏病、肾小球肾炎;研究生课程:急性肾损伤、肾脏病与免疫。有多篇学术文章发表。特长:肾结石,肾衰竭，肾积水，肾移植等。','主任医师',115,'lufumin_1','陆福明.jpg'),(2,'吴开心',40,'1991年起一直在华山医院神经内科临床一线工作。一直从事癫痫、脑血管病、睡眠障碍、疼痛等神经内科疾病的诊治研究以及脑电图的临床应用和实验研究,发表论文50余篇参与编写多部专著','主任医师',110,'wukaixin_2','吴开心.jpg'),(3,'黄毕设',38,'医学博士。兼任中国医师协会男科医师分会常委、中国医师协会前列腺健康与咨询专家委员会副主任委员、中国医师协会上海泌尿外科医师分会副会长、全军泌尿外科专业委员会常委、海军泌尿外科专业组副主委，入选“国家教育部创新团队”。主编专著5部，副主编专著2部，参编6部，发表SCI、国内核心期刊等论文100余篇，获批国家发明专利7项。特长:肾结石,膀胱癌,前列腺炎,前列腺增生,前列腺癌,尿结石,输尿管结石','主任医师',201,'huangbishe_3','黄毕设.jpg'),(4,'梅头脑',45,' 泌尿系统疾病、肿瘤、结石、肾上腺巨大肿瘤、前列腺疾病，男性功能障碍，性病，尿力动力学检测、微创腔内泌尿外科手术、尿失禁。特长:肾结石,膀胱癌,前列腺炎,前列腺增生,前列腺癌,尿结石,输尿管结石','主任医师',201,'meitounao_4','梅头脑.jpg'),(5,'王聪明',48,'1993年从上海医科大学医学系英文班毕业，在复旦大学附属华山医院皮肤科工作二十多年，对常见性和危重疑难性皮肤病的诊治具有较好的水平。2003年-2004年在美国CaseWesternReserveUniversity从事博士后研究工作。现任华山医院皮肤科主任医师、教授、博士研究生导师。特长:皮肤过敏、皮炎、湿疹、疱疹、疥疮、牛皮癣、手足癣、脚气、掌指汗疱疹、粉刺、痤疮、日光过敏性皮炎、白癜风','主任医师',138,'wangcongming_5','王聪明.jpg'),(6,'郑伟大',42,'上海市长海医院妇产科主任，主任医师，教授，博士，博士生导师。中华医学会肿瘤学分会妇科肿瘤学组委员，中国抗癌协会妇科肿瘤分会委员，中国医促会妇产科分会常务，中国老年协会妇科分会常委，全国宫颈癌防治协作组成员，上海医学会妇产科分会委员，上海医学会妇科肿瘤分会委员，浦东新区医学会妇科专委会副主任委员，《实用妇产科杂志》常委编委，《实用癌症杂志》编委。培养硕士研究生25人，博士研究生3名。特长:痛经，宫外孕，流产，子宫颈瘤，产后抑郁，人工授精等。','主任医师',162,'zhengweida_6','郑伟大.jpg'),(7,'黄恩浩',30,'这是院长。','普通医生',109,'me','me.jpg'),(8,'欧阳',32,'这是个好医生','普通医生',109,NULL,'commonPhoto.jpg'),(9,'皇甫',30,'这是个好医生','普通医生',110,NULL,'commonPhoto.jpg'),(10,'孙易',32,'这是个好医生','普通医生',110,NULL,'commonPhoto.jpg'),(11,'窦怀盼',30,'这是个好医生','普通医生',111,NULL,'commonPhoto.jpg'),(12,'周风梦',32,'这是个好医生','普通医生',111,NULL,'commonPhoto.jpg'),(13,'许莲寻',30,'这是个好医生','普通医生',112,NULL,'commonPhoto.jpg'),(14,'冯冷灵',32,'这是个好医生','普通医生',112,NULL,'commonPhoto.jpg'),(15,'戚平',30,'这是个好医生','普通医生',113,NULL,'commonPhoto.jpg'),(16,'彭易涵',32,'这是个好医生','普通医生',113,NULL,'commonPhoto.