/*Table structure for table `hospital` */

DROP TABLE IF EXISTS `hospital`;

CREATE TABLE `hospital` (
  `hospitalId` varchar(40) NOT NULL,
  `hospitalName` varchar(20) DEFAULT NULL,
  `hospitalAddress` varchar(100) DEFAULT NULL,
  `hospitalPhone` varchar(20) DEFAULT NULL,
  `hospitalPhoto` varchar(100) DEFAULT NULL,
  `hospitalLevel` varchar(30) DEFAULT NULL,
  `hospitalDescription` text,
  PRIMARY KEY (`hospitalId`)
