insert  into `hospital`(`hospitalId`,`hospitalName`,`hospitalAddress`,`hospitalPhone`,`hospitalPhoto`,`hospitalLevel`,`hospitalDescription`) values ('1','复旦大学附属华山医院','上海市静安区乌鲁木齐中路12号',' 021-52889999','huashan.jpg','三级甲等','复旦大学附属华山医院创建于1907年，是复旦大学附属综合性教学医院和中国红十字会直属医院，1992年首批通过国家三级甲等医院评审，目前已成为国家级高层次的医教研中心之一，在国内外享有较高声誉。 华山医院医疗技术力量雄厚，全院2000余名职工之中，医疗专业技术人员占80%，其中副高职以上专家300多人，中国科学院和中国工程院院士各1名。在全国学术性机构任主任委员或副主任委员13人，在上海学术性机构任主任委员或副主任委员28人。许多专家教授在国内外享有较高知名度。 全院共设34个临床医技科室，是一个特色学科很多的医院，尤以神经内外科、皮肤科、手外科、中西医结合、传染病科、脊柱和关节外科、肾脏病科、泌尿外科、肾移植、胰腺外科、乳房外科、内分泌科、职业病和风湿科、颌面外科、影像医学和核医学、运动医学、康复医学为特长，其中神经外科、手外科、中西医结合科、泌尿外科、神经内科、传染病学和抗生素、肾病科、心血管科、影像医学和核医学、普外科为国家级重点学科，临床神经医学、手外科为上海市领先学科，神经外科、手外科被命名为上海市临床医学中心。 华山医院有核定床位1326张，因其较高的医疗质量和良好的服务而深受病人欢迎，同时也因有较好的医疗特色吸引了全国各地的病人，全院每年门急诊就诊病人150余万人次，住院病人2万余人次，其中有50%左右是由全国各地转来的各种疑难杂症，尤其是神经内外科、手外科及皮肤科比例更高。肾透析中心、重症监护中心(ICU)都具有相当规模和水平。重危病人抢救成功率达90%以上。从1996年起还建立了“卫星远程会诊中心”，可为全国各地病人通过卫星进行远程会诊。 为方便广大病员和适应不同层次医疗需求，医院实行年中无休制度并开展了特需医疗服务，设有专家门诊、疑难杂症诊疗中心及特需服务部。1989年医院在沪首先开设涉外病房，收治了来自世界60多个国家的近万名病人，深受海外病员的信任,1994年获驻沪八个领事馆赠送的荣誉金牌。医院还相继成立了中外合作的眼病中心、伽玛医院和高等病房。 在完成大量的医疗任务同时，医院还承担着繁重的科研与教学工作。近5年来医院获省部级以上成果45项，获卫生部临床重点项目4项，复旦大学“985”工程学科4项，有10个学科被国家教育部评为重点学科。医院设有19个博士点，32个硕士点，每年承担培养硕士生220余名，博士生210余名及博士后流动的教学任务，并且还是复旦大学本科生的主要教学与实习基地。 复旦大学附属华山医院是复旦大学上海医学院（原上海医科大学）附属的一所综合性教学医院。建院于1907年，前身是中国红十字会总院，是上海地区中国人最早创办的医院，1991年重新恢复为中国红十字会直属医院。1992年首批通过国家三级甲等医院评审，目前已成为一所国家高层次的医疗机构，并为全国医疗、预防、教学、科研相结合的技术中心，在国内外享有较高的声誉。'),('10','上海市中西医结合医院','上海市虹口区保定路230号','021-65415910','zhongxi.jpg','三级甲等医院','中心本着人性化、关爱室理念，查体全过程做到一站式服务。面对社会各界，根据年龄职业、性别、身体状况、经济基础等不同情况，设计了各种体检套餐，以方便受检者的选择。并提供\"普通健康体检\"、\"特需健康体检\"和\"医疗保健咨询\"等服务。 　　中心体检项目齐全，检查设备精良，有先进的CT机、骨密度仪、电子胃镜、肠镜、心彩超、B超机、电脑全自动心电图机、12导心电生理仪、大型电子血压仪、近红外线乳腺检查仪、全自动血液生化检测仪等。 　　中心的宗旨是：为社会各界提供优质、高校、满意、便捷的体检服务。 　　体检中心的地址：虹口区保定路184号 　　邮政编码：200082 　　电话、传真：021--35110016'),('2','复旦大学附属中山医院','上海市徐汇区枫林路180号',' 021-64041990','zhongshan.jpg','三级甲等医院','复旦大学附属中山医院是卫生部部属综合性教学医院。医院开业于1937年，是当时中国人管理的第一所大型综合性医院，隶属于国立上海医学院，为纪念中国民主革命的先驱孙中山先生而命名为孙中山纪念医院，后更名为中山医院。解放后曾称上海第一医学院附属中山医院和上海医科大学附属中山医院，2001年用现名。 经过70多年的发展，中山医院本部目前占地面积95892.1m^2，总建筑面积185736.27m^2，核定床位1700张。2010年门急诊就诊量263万人次，出院病人6.9万人次，住院手术病人4.5万人次。全院职工2986人，拥有中国工程院院士2人，高级职称375人，医师956人，护士1165人，医技人员239人。 院本部设有除小儿科以外的所有科室、综合实力雄厚。心脏、肝癌、肾脏和肺部疾病诊治是医院的重点和特色，诊治水平始终处于国内领先地位。其中心血管病和肝肿瘤是上海市临床医学中心。消化科、检验科和麻醉科是国家临床重点学科。上海市心血管病研究所、复旦大学肝癌研究所、上海市影像医学研究所、上海市中西医结合康复研究所、复旦大学呼吸病研究所、复旦大学血管外科研究所、复旦大学普通外科研究所、复旦大学内镜诊疗研究所、复旦大学核医学研究所设在院内，成为医院重要的研究机构。上海市的院内感染、超声诊断、呼吸内科、心血管内科、胸心外科、普通外科6个临床质量控制中心也挂靠中山医院。医院每年承担国家、卫生部和上海市重大科研项目近百项。近年获国家级、教育部、卫生部和上海市科技成果奖百项。设有博士点15个，硕士点21个，有卫生部专科医师培训基地22个，上海市住院医师培训基地26个。每年举办国家级继续医学教育学习班40期，招收进修医生600名，为国家培养了许多高级医学人才。 医院拥有先进的医疗设备，包括断层放射治疗系统(Tomo Therapy)、PET-CT、320排640层超速螺旋CT、全数字平板式心血管造影机(DSA)、直线加速器、3.0T磁共振断层扫描仪、达芬奇机器人手术系统、单光子发射计算机断层扫描仪(SPECT)、数字化X线成像系统(DR)、重症监护系统和远程医疗教学系统等等。 与香港保健协会合作建立的上海逸仙医院为境内外人士服务，深受欢迎。 中山医院始终秉承“以病人为中心”的精神，倡导“严谨、求实、团结、奉献”的院训，以严谨的医疗作风、精湛的医疗技术和严格的科学管理，努力为国内外病人提供更多更好的医疗服务。'),('3','上海交通大学医学院附属瑞金医院','上海市黄浦区瑞金二路197号','021-64370045','ruijin.jpg','三级甲等医院',' 上海交通大学医学院附属瑞金医院(上海瑞金医院)建于1907年，原名广慈医院，是一所三级甲等大型综合性教学医院。医院占地面积12万平方米，建筑面积24.5万平方米，绿化面积4万平方米，核定床位1600张，全院职工3445人，其中医师1010余人(其中正副教授及各类高级科技人员593人)。拥有中国科学院院士陈竺、中国工程院院士王振义、陈赛娟等一大批在国内外享有较高知名度的医学专家。医院设有34个临床科室、9个医技科室;现有国家教育部重点学科3个(内分泌、血液、消化)，上海市重中之重学科1个(血液)，上海市重点学科1个(内分泌)，上海市优势学科一个(肾脏)，上海市教委重点学科6个(消化外科、血液科、内分泌科、骨科、烧伤科、心脏内科)，上海市卫生局医学领先专业重点学科3个(消化外科、血液科、肾脏内科)。医院还有6个市级研究所(上海市伤骨科研究所、上海市高血压研究所、上海市内分泌研究所 、上海烧伤研究所、上海血液学研究所、上海消化外科研究所)，2个校级研究所(上海交通大学医学院神经病学研究所、上海交通大学心血管病研究所)，1个院级研究所(感染病与呼吸病研究所)，8个校级研究室，3个院级实验室。此外，还建立了国家重点实验室和教育部重点实验室各1个(医学基因组学重点实验室)，2个卫生部重点实验室(人类基因组重点实验室、内分泌代谢重点实验室)，4个上海市重点实验室(人类基因组研究重点实验室、血管生物学重点实验室、中西医防治骨关节病损重点实验室、内分泌肿瘤重点实验室)。并通过整合上述科研力量，建立了附属瑞金医院生物医学研究院。同时，还建有与临床诊疗密切结合的一些中心，包括分子医学中心、糖尿病研究中心、血栓与止血研究中心、血液病诊治中心、基因诊断中心、眼科中心、青少年生长发育中心、介入治疗中心、生殖医学中心等。另外上海市卫生局有4个质量控制中心(康复、骨科、心脏介入、血液)挂靠在瑞金医院。瑞金医院于20世纪50年代成功抢救邱财康后，大面积烧伤治疗始终处于世界先进水平;70年代在国内率先开展了心脏和肝脏的移植手术;90年代在白血病分子生物学研究和临床医疗领域取得了重大进展;21世纪日臻完善的器官移植，使得许多病人将这里视为生命的绿洲。为此，医院获得了全国卫生系统先进集体(6次)、全国百佳医院;全国创建文明行业先进集体、全国卫生系统先进思想政治工作研究会;上海市文明单位(9次);全国模范职工之家;全国青年文明号、全国\"五四\"红旗团组织创建单位等。瑞金医院以所取得的成就和荣誉为动力，为了进一步适应市场需求，医院积极开展高精尖诊疗技术，如微创伤手术、关节镜手术、心血管介入治疗、眼科准分子激光术等，并充分利用医院综合医疗优势，实行多学科或跨学科联合会诊制，使医疗诊治水平日益提高。同时医院还将发展目标定位在研究型医院上，借助医院9个市级研究所，医院在肾脏内科、消化内科、内分泌、高血压、中医伤科、急性坏死性胰腺炎、生殖医学等学科中颇具特色，特别是国家重点研究所的科研优势，立足临床加大科研力度，为人民健康创造出了许多临床新成果。医院还不断深化人性化服务，推出了\"以优质的医疗使病人放心、以一流的服务使病人称心、以优美的环境使病人舒心\"的\"三心工程\"，以温馨、便捷、优质、高效的服务赢得了社会和病家的信任，促进了医院两个文明建设的发展。瑞金医院是上海交通大学医学院最大的临床教学基地，\"瑞金临床医学院\"也设在医院中，承担医学系、检验系、高级护理系的临床教学任务，并接受上海交通大学医学院夜大学、高级医师进修班及来自全国各地医院的进修学员的临床教学任务。近年来，瑞金医院获得各类科研项目300余项，包括国家自然科学基金重大项目、重点项目、面上项目、国家科委863项目、S863项目、973项目、攀登计划、国家八五攻关项目、九五攻关项目、卫生部科研项目、国家教委留学生基金项目、上海市级科研项目等重大项目。医院现有硕士生点29个、博士生点22个，具有招生资格的博士生导师66名、具有招生资格的硕士生导师84名，内、外科均为博士后流动站。医院的科研技术人才在国家杰出人才基金、国家教委跨世纪人才培养基金、上海市启明星计划、启明星后计划、上海市曙光计划、上海市卫生系统百名跨世纪优秀学科带头人计划中占有较重比例。还获得一系列有很高含金量的国际奖项，如：美国灼伤协会伊文思奖，意大利惠特克国际烧伤奖，美国凯特林癌症奖，瑞士布鲁巴赫癌症研究奖，法国卢瓦茨奖和祺诺台杜加奖，以及香港何梁何利基金技术奖等。为了引进先进的技术和设备，瑞金医院还积极开展对外交流与协作，与法国、美国、英国、加拿大、比利时、日本、澳大利亚等国家和香港、台湾、世界卫生组织等地区和组织有着广泛的联系，并建立了多项科研合作。 1999年8月4日，为了贯彻落实国家卫生改革工作的精神，探索市场经济条件下医院发展的新模式，实现\"以比较低廉的价格提供比较优质服务\"的宗旨，瑞金医院率先与部分医疗机构实行资产重组，建立了上海瑞金医院集团，初步实现了跨地区、跨行业、跨级别、跨部门医疗资源的重组，使以瑞金医院为核心的区域医疗卫生中心逐步形成。多年来，瑞金医院与集团下属的医院分部、卢湾分院、闵行医院和台州中心医院都取得了明显的经济效益和社会效益。 2002年10月25日，瑞金医院在科研工作模式的探索上又迈出了坚实的一步，在国内开创性的成立了\"生物医学研究院\"。从而形成了\"大科研\"的新格局，实现科研体制、用人机制和科学研究等的全面创新。该研究院以瑞金医院的研究力量为主，联合中国科学院上海生命科学研究院、原上海第二医科大学健康科学中心、国家人类基因组南方中心等科研单位，是我国第一个以医院为主体的、将生命科学与临床医学紧密结合的研究与开发机构。研究院所奉行的\"但求所用，不求所有\"的用人原则，真正实现了人才的\"柔性流动\"，使更多科研人员有了施展才华的舞台和空间。 2010年瑞金医院门急诊人次达270.6万，手术例数达4.12万次，出院病人7.6万人次，平均住院天数为8.68天。'),('4','上海交通大学医学院附属仁济医院东院','上海市浦东新区浦建路160号','021-58752345','renjieast.jpg','三级甲等医院','上海交大医学院附属仁济医院建于1844年，是上海开埠后第一所西医医院，迄今已有161年的历史，她是中国最早的综合性西医医院之一，是我国近代医学的摇篮...... 　　医院的规模不断扩大，尤其是建国五十多年来，医院得到了迅速地发展，成为学科门类齐全，集医疗、教学、科研于一体的综合性三级甲等医院。医院由东西二部组成。西部位于上海市黄浦区中央商务区内，毗邻外滩；东部位于浦东陆家嘴金融贸易区内。新中国成立之后，仁济医院取得了许多临床医学成果，填补了我国医学的多项空白，如心脏二尖瓣狭窄分离术，使心脏手术从心外进入心内禁区；低温麻醉下心内直视脉动脉脉瓣切开术，是我国心内直视技术的开端；低温麻醉房间隔缺损直视修补，则使低温直视心内手术上了新台阶；针刺麻醉下体外循环心内直视手术成功，更是我国的开创性医学成果。此外，国内首次成功施行的皮肾静脉吻合术、门腔静脉吻合分流术、晚期吸血虫病外科治疗、脾血回输新技术等，都具有相当高的水平。　　1999年10月，仁济东院建成投入使用，摆脱了长期困扰医院发展的地域限制，医院占地面积由原来的14亩扩大为145亩。床位数由原来的700张增加到1300张。医疗技术力量雄厚，拥有在职正高职称专家117名，副高职称专家281名，年门诊量达到190万人次，住院人数达3万余人次，年手术1.9万余例。　　仁济重视学科建设与人才培养。目前，拥有上海市消化疾病研究所、上海市风湿疾病研究所和上海市男科学研究所；拥有上海市唯一的人类精子库、上海市产科心脏病监护中心、上海市血液透析和激光医学两个质控中心。近年来培育形成了一批技术先进，充满活力的优势学科群。拥有PET-CT、3.0T磁共振、直线加速器等一流设备。承担了浦东地区大部分急救任务。近5年来，申请到局级以上（含局级）科研项目150余项，申请专利23项，其中实用型专利11项，在全国医疗机构中名列前茅。 3人获\"上海市领军人才\"称号，28人入选上海市各类人才培养计划。　　在全市三级综合性医院中率先推行并通过ISO9001质量管理认证体系。仁济医疗管理有限公司已成功托管江浙沪地区二甲以上共12家医院；涉外全康国际医疗中心为驻沪外籍人士提供最具质量和诚信的医疗保障。　　近三年在上海市万人问卷调查中病人满意率处于全市前列。连续七次荣获全国卫生系统先进集体称号，连续八次获上海市卫文明单位称号。'),('5','上海交通大学医学院附属仁济医院西院','上海市黄浦区山东中路145号','021-63261796','renjiwest.jpg','三级甲等医院','仁济医院建于1844年，是上海开埠后第一所西医医院，迄今已有160多年的历史。仁济医院是一个学科门类齐全，集医疗、教学、科研于一体的综合性三级甲等医院。医院目前由东西南北四个院区组成：东院位于浦东陆家嘴金融贸易区内，于1999年10月建成投入使用，占地86875平方米，总建筑面积205425平方米；西院位于上海市黄浦区中央商务区内，毗邻外滩，占地7811平方米，总建筑面积31959平方米；在建中的南院位于闵行区浦江镇，紧邻世博家园，共占地71000万平方米，总建筑面积72000平方米；在建中的北院占地6667平方米，总建筑面积17350平方米。医院目前总核定床位1400张。医院医疗技术力量雄厚，设有临床科室34个，临床医技科室8个；共有职工2700余人，其中正、副高级职称专家400余名；医院拥有细胞刀、超声刀、核磁共振仪、128排CT、数字X线摄片机、PET-CT等众多先进的大型医疗设备；据最新统计资料，年门急诊病人超过250万人次，住院病人6万余人次，完成各类手术3万多台。'),('6','上海市黄浦区香山中医医院','上海市黄浦区复兴中路528号','021-53061730','xiangshan.jpg','二级医院','上海市黄浦区香山中医医院（原上海市卢湾区香山中医医院）建于1985年10月，系上海市最早成立的二级甲等中医医院之一，上海中医药大学硕士研究生学位点，上海市卫生系统文明单位。医院位于复兴中路528号，地处孙中山故居西侧，南傍中国共产党驻沪办事处（周公馆）。周边环境优美，绿树成荫，占地面积约6000m²。\n医院有G.P.P认证的中药制剂室，开设内、外、伤、康复、针灸、推拿、妇、儿、眼、五官、皮肤、肛肠、口腔等多个临床科室，还有20多个专病专科门诊，如腰椎间盘突出症、颈椎病、肩周炎、小儿推拿、骨关节病、骨刺、中风、脾胃病、肛肠病、糖尿病、失眠、肿瘤、哮喘、青少年助长门诊等。其中，施氏伤科被列为上海市非物质文化遗产项目、上海市临床中医重点学科；肛肠科被评为上海市中医临床优势专科，中医脾胃病为区重点专科建设项目。\n香山骨伤科传承于沪上伤科八大家之一的\"施氏伤科\"，以施氏医学理念为主导，专科的特色是运用施氏伤科传统治疗措施，以中药内服外敷结合手法治疗为主，以物理治疗为助，结合功能训练和健康教育，对骨伤科疾病进行预防--治疗--康复的系统诊疗。作为上海市的医学特色领先专科，在治疗腰椎间盘突出症、肩周炎、骨关节病、骨质疏松症、颈椎病等具有明显优势，在上海享有极高的声誉。\n香山肛肠科经过多年的医疗实践，大胆创新，将传统医学经典的痔结扎法原理与现代医学PPH术式的精髓有机融合起来，采用独创的\"结扎悬吊修切法\"，并荣获了上海市中医药科技进步奖。\"无痛肛肠手术\"成为香山肛肠外科的鲜明特色，为数以万计的患者解决了\"难言之隐\"。\n香山中医医院遵循\"承歧黄古道，建特色香山，创中医未来\"的理念，汇聚了以\"上海市名中医\"领衔牵头的多个学科团队，正在打造初具规模的\"香山名医馆\"，以期为患者提供更优质的中医特色医疗服务。'),('7','上海邮电医院','上海市长乐路666号','021-54047060','youdian.jpg','二级医院','上海邮电医院秉承“立足邮电，面向社会，尽心尽职，救死扶伤”的服务宗旨，在上级公司和卫健委的支持与关怀下，科学管理，深化改革，开拓创新，积极适应医改工作的需要，在服务企业的同时主动融入社会区域医疗规划，承担地方医疗预防保健和治疗工作。在加强医疗行业管理的同时，借鉴企业经营管理的手段和方法，使医院得到良性运营与发展，在探索企业医院可持续发展道路上不断取得成效。医院创建于1951年，是建国后上海最早建立的职工医院之一，是一所集临床医疗、预防保健、健康体检为一体的医保定点二级甲等医院。由座落在长乐路的本部和位于复兴中路的南部健康体检中心共同组成，加之遍布上海邮电企业医疗巡回点及社区医疗咨询点，形成独特的一体化医疗保健网络。本部位于市中心，基础科室齐全，特色专科众多。微创外科、呼吸内科、消化内科、心血管内科、康复医学科、中医综合治疗、口腔种植牙和白内障手术是医院的优势科目。近年来，与多家三级医院组成医联体，如加入仁济医院医联体、长征医院市中心创伤急救医联体、市眼病防治中心专科医联体、长海医院疼痛专科医联体、同济医院康复联盟等，与瑞金医院胸痛中心、华山医院胸痛中心、仁济医院骨科、新华医院胸外科等专科建立分级诊疗合作，合作成立上海复旦临床病理诊断中心-上海邮电医院病理会诊平台。作为“静安区特色专科”的呼吸内科是老年肺部感染和呼吸衰竭防治联盟成员之一。南部座落于复兴中路，集体检、体测、门诊于一体，可提供大规模人群的健康体检评估和健康干预，是上海市体检质控中心质量督查优秀单位。 '),('8','上海中医药大学众益达中医门诊部','闵行区七宝镇新镇路1151号1幢、2幢',' 021-52210793','yida.jpg','一级医院','上海众益达中医门诊部座落于具有丰厚文化底蕴的七宝古镇旁。是一所由上海中医药大学出资创办的集医疗、教育、科研为一体的医疗机构。同时也是上海中医药大学名中医学术传承示范基地、膏方养生实践基地、医养结合实践基地。门诊部汇集了来自龙华医院、曙光医院、岳阳医院等上海中医药大学各附属医院专家团队。通过开展传统的中医诊断、中医治疗、中医预防保健等辩证施治手段，为广大病患提供优质中医药服务。'),('9','上海长海医院','上海市杨浦区长海路168号','021-31166666','changhai.jpg','三级甲等','　 第二军医大学附属长海医院创建于1949年，是一所集医疗、教学、科研为一体的现代化大型综合性医院。1993年首批评为三级甲等医院。1998年荣膺全国百佳医院称号。连续13届获上海市\"文明单位\"称号。\n 　　医院占地32万平方米，建筑面积27.6万平方米，其中工作用房17.6万平方米，生活用房10万平方米，实现了医疗区、教学科研区、生活区三区分离。现拥有病房大楼、科技大楼、医技楼、第二医技楼、胸心疾病诊治大楼、门急诊楼、影像诊断中心楼、感染科楼、康宾楼、生殖研究中心楼、制剂楼等布局合理、设施先进的医疗建筑群，以及供病人休息的\"怡园\"、\"馨园\"等环境优雅、景色怡人的场所。医院设有科室49个，展开床位1800余张。拥有一批国内外知名的专家教授和中青年技术骨干。医院现有博士点25个、硕士点40个，并设博士后流动站4个。每年完成医疗、药学、护理等专业和外国留学生共3000多名学生的教学任务。60年代以来先后形成肝胆外科、胸心外科、烧伤外科、创伤外科、血液内科、消化内科等特色学科。目前拥有国家级重点学科15个，全军专科研究所、中心13个，全军重点实验室2个，上海市临床医学中心2个，上海市医学质控中心3个，上海市示范学科1个，现为全军、全国临床药理基地。部分研究项目具有国际先进水平。医院注重高新技术的创新和运用，在脑血管病防治、血管外科、影像诊断、X线刀、微波治疗、腹腔镜手术、\"细胞刀\"治疗帕金森病、整形整容、准分子激光近视手术、钬激光治疗泌尿系结石、肛肠疾病诊治、放射治疗、介入治疗、基因治疗、创伤救治、房间隔缺损封堵、颈椎脊柱病诊治、中晚期肝癌的中西医结合治疗及血液净化等方面各展所长，形成了新的特色。');

/*Table structure for table `hospital_department` */

DROP TABLE IF EXISTS `hospital_department`;

CREATE TABLE `hospital_department` (
  `hos_dep_Id` int(11) NOT NULL AUTO_INCREMENT,
  `hospitalId` varchar(40) NOT NULL,
  `departmentId` varchar(40) NOT NULL,
  PRIMARY KEY (`hospitalId`,`departmentId`),
  KEY `departmentId` (`departmentId`),
  KEY `hos_dep_Id` (`hos_dep_Id`),
  CONSTRAINT `hospital_department_ibfk_1` FOREIGN KEY (`hospitalId`) REFERENCES `hospital` (`hospitalId`),
  CONSTRAINT `hospital_department_ibfk_2` FOREIGN KEY (`departmentId`) REFERENCES `department` (`departmentId`)
